pragma solidity ^0.8.7; //for supported version

contract BasicDataStorage{

    uint32 public unique_id;
    bool status;

    mapping (uint32 => bool)  DataMap;

    function getStatus(uint32 _uniqueId) public view returns (bool) {
        return DataMap[_uniqueId];
    }

     function setStatus(uint32 _uniqueId , bool _status) public {
         DataMap[_uniqueId]=_status;

    }
}

